import React from "react";
import ReactDOM from "react-dom";

//Create heading component.
//Name of this component is Heading
function Heading(){
    return <h1>My To Do List</h1>
}

ReactDOM.render(
    <div>
    {/* Calling the  */}
        <Heading />
        <ul>
            <li>Go Shopping</li>
            <li>Do Exercise</li>
            <li>Reserve Hotel</li>
        </ul>
    </div>
,
document.getElementById("root"));
